# -*- coding: utf-8 -*-
import pytest

from agentbricks.models.embedding import MultimodalEmbedding
from agentbricks.schemas.embedding import EmbeddingResponse


# Fixtures
@pytest.fixture
def text_input():
    return {"text": "通用多模态表征模型"}


@pytest.fixture
def image_input():
    return {
        "image": "https://mitalinlp.oss-cn-hangzhou.aliyuncs.com/dingkun"
        "/images/1712648554702.jpg",
    }


@pytest.fixture
def video_input():
    return {
        "video": "https://help-static-aliyun-doc.aliyuncs.com/file-manage"
        "-files/zh-CN/20250107/lbcemt/new+video.mp4",
    }


@pytest.fixture
def image_base64_input():
    return {
        "image": """data:image/jpeg;base64,""",  # noqa E501
    }


@pytest.fixture
def multimodal_embedding_model():
    return MultimodalEmbedding()


@pytest.mark.asyncio
async def test_multimodal_embedding_arun(
    multimodal_embedding_model,
    text_input,
    image_input,
    video_input,
):
    inputs = [
        text_input,
        image_input,
        video_input,
    ]
    response = await multimodal_embedding_model.arun(
        input=inputs,
        model="multimodal-embedding-v1",
    )
    assert isinstance(response, EmbeddingResponse)
    assert hasattr(response, "data")
    assert len(response.data) > 0 and len(response.data) == len(inputs)
    assert hasattr(response.data[0], "embedding")


@pytest.mark.asyncio
async def test_image_base64_multimodal_embedding_arun(
    multimodal_embedding_model,
    image_base64_input,
):
    inputs = [
        image_base64_input,
    ]
    response = await multimodal_embedding_model.arun(
        input=inputs,
        model="multimodal-embedding-v1",
    )
    assert isinstance(response, EmbeddingResponse)
    assert hasattr(response.data[0], "embedding")
    assert len(response.data) > 0 and len(response.data) == len(inputs)
